def load_scaler(scaler_filename):
    with open(scaler_filename, 'rb') as file:
        scaler = pickle.load(file)
    return scaler

def streamlit_load_scalers():
    #Specify the filenames of the scaler files
    scaler_files = ['luxury_car_makes_scaler.pkl','suv_df_scaler.pkl','sedan_df_scaler.pkl','coupe_df_scaler.pkl','hatchback_df_scaler.pkl' ,'pickup_df_scaler.pkl', 'station_wagon_df_scaler.pkl','minivan_df_scaler.pkl', 'van_df_scaler.pkl', 'convertible_df_scaler.pkl', 'Expensive_car_makes_scaler.pkl']
 
    #Create an empty dictionary to store the scaler objects
    scaler_dict = {}
    
    #Load the scaler objects and store them in the dictionary
    for scaler_filename in scaler_files:
        scaler_name = scaler_filename.split('_scaler.pkl')[0]
        scaler = load_scaler(scaler_filename)
        scaler_dict[scaler_name] = scaler
    
    return scaler_dict

