def load_models():
    models = {}

    #List of model names and their corresponding file paths
    model_files = [('model_suv.pkl', 'suv'),('model_sedan.pkl', 'sedan'),('model_coupe.pkl', 'coupe'),('model_hatchback.pkl', 'hatchback'),('model_pickup.pkl', 'pickup_truck'),('model_station_wagon.pkl', 'station_wagon'),('model_minivan.pkl', 'minivan'),('model_van.pkl', 'van'), ('model_convertible.pkl', 'convertible'), ('model_luxury.pkl', 'luxury'), ('model_expensive.pkl', 'expensive') ]

    for model_file, model_name in model_files:
        with open(model_file, 'rb') as f:
            model = pickle.load(f)
            models[model_name] = model

    return models

