#Function to normalize the inputs from the user using the scaler models
def normalize_car_features(car_features, scaler_filename):
    #Get the specific scaler file
    scalers = streamlit_load_scalers()
    scaler = scalers.get(scaler_filename)
    if scaler:
        #Normalize the car_features data
        normalized_car_features = scaler.transform(car_features)

        #Flatten the normalized_car_features (since it's a 2D array) and convert it to a list
        normalized_car_features_list = normalized_car_features.flatten().tolist()
        return [normalized_car_features_list]
    else:
        #Handle the case when the specified scaler file is not found
        st.error("Scaler file not found!")
        
#Function to predict car prices useing the models created from the data
def predict_car_price(car_features, body_type,make_name_model,models):
     #list of luxury cars 
    luxury=["Audi","BMW","Jaguar","Land Rover","Lexus","Lotus","Mercedes-Benz","Tesla","Cadillac","Lincoln","Genesis","Maserati", "Porsche"]
            
     #list of extremely expensive cars
    expensive=["Aston Martin","Bentley","Bugatti","Ferrari","Lamborghini","McLaren","Rolls-Royce","Koenigsegg","Maybach","Pagani", "Saleen"]
    
    # Predict the car price based on the makebody type
    if make_name_model in luxury:
        model = models['luxury']
        normalize_features = normalize_car_features(car_features, 'luxury_car_makes')
    elif make_name_model in expensive:
        model = models['expensive']
        normalize_features = normalize_car_features(car_features, 'Expensive_car_makes')
    elif body_type == 0:
        model = models['suv']
        normalize_features = normalize_car_features(car_features, 'suv_df')
    elif body_type == 1:
        model = models['sedan']
        normalize_features = normalize_car_features(car_features, 'sedan_df')
    elif body_type == 2:
        model = models['coupe']
        normalize_features = normalize_car_features(car_features, 'coupe_df')
    elif body_type == 3:
        model = models['hatchback']
        normalize_features = normalize_car_features(car_features, 'hatchback_df')
    elif body_type == 4:
        model = models['pickup_truck']
        normalize_features = normalize_car_features(car_features, 'pickup_df')
    elif body_type == 5:
        model = models['station_wagon']
        normalize_features = normalize_car_features(car_features, 'station_wagon_df')
    elif body_type == 6:
        model = models['minivan']
        normalize_features = normalize_car_features(car_features, 'minivan_df')
    elif body_type == 7:
        model = models['van']
        normalize_features = normalize_car_features(car_features, 'van_df')
    elif body_type == 8:
        model = models['convertible']
        normalize_features = normalize_car_features(car_features, 'convertible_df')
    else:
        #Printing out an error if no model is selected
        st.error("Something is wrong with either the body type, normalization function, or prediction function!")
        return None
    
    # Make the car price prediction
    prediction = model.predict(normalize_features)
    
    return prediction
      
#Function for image preprocessing
def preprocess_image(image):
    # Resize the image to a specific size
    resized_image = image.resize((224, 224))
    #Convert the image to a numpy array
    processed_image = np.array(resized_image)
    return processed_image

#Function for predicting the make and model from the image
def predict_make_model_image(model, label_mapping,processed_image):
    # Use the processed image to predict the make and model
    predictions = model.predict(np.expand_dims(processed_image, axis=0))
    predicted_class_indices = np.argmax(predictions, axis=1)
    predicted_classes = [label_mapping[idx] for idx in predicted_class_indices]
    return predicted_classes[0]

def predict_image_class(model, label_mapping, image, confidence_threshold=0.9):
    predictions = model.predict(np.expand_dims(image, axis=0))
    top_class_idx = np.argmax(predictions)
    top_probability = predictions[0][top_class_idx]
    
    if top_probability >= confidence_threshold:
        predicted_class = label_mapping[top_class_idx]
        return predicted_class
    return None


